<script setup>
import { ref, onMounted } from 'vue';

const popupActive = ref(false);
const popupShown = ref(false);

const showPopup = () => {
	popupActive.value = true;
	setTimeout(() => {
		popupShown.value = true;
		setTimeout(() => {
			window.addEventListener('click', hidePopup)
			window.addEventListener('touchstart', hidePopup);
		}, 1000);
	}, 750);
};

const hidePopup = () => {
	window.removeEventListener('click', hidePopup);
	window.removeEventListener('touchstart', hidePopup);
	popupShown.value = false;
	setTimeout(() => {
		popupActive.value = false;
	}, 250);
};

onMounted(() => {
	showPopup();
});

</script>

<template>
	<div v-if="popupActive" class="under-construction-popup" :class="popupShown ? 'shown' : ''">
		<div class="wrap">
			<div class="flex flex-row gap-6 justify-center items-center">
				<img class="digger-image" src="data:image/png;base64," alt="digger">
				<div class="flex flex-col gap-3 justify-center">
					<h2>Hello traveler!</h2>
					<section class="flex flex-col gap-1">
						<p>Thanks for visiting my website! This website is still a work in progress so things may be <span class="broken">broken</span> or <span class="missing">missing</span>.</p>
						<p>Eventually it will be finished, I promise :)</p>
						<p>Click anywhere on the screen to make this popup go away.</p>
					</section>
				</div>
			</div>
		</div>
	</div>
</template>

