	padding: 1vh 0;
	left: 0;
	bottom: 0;
	color: #000;
	background-color: #fdc02d;
	box-shadow: -10px 0 120px 20px #000;
	z-index: 9999;

	&::before {
		content: '';
		position: absolute;
		width: 100%;
		height: 10px;
		top: -10px;
		left: 0;
		background: repeating-linear-gradient(
			-45deg,
			black,
			black 10px,
			orange 10px,
			orange 20px
		);
	}

	transform: translateY(calc(100% + 10px));
	transition: transform 250ms ease-out; // for hiding

	&.shown {
		transform: translateY(0);
		transition: transform 750ms ease-in; // for showing
	}

	.digger-image {
